import React from 'react'
import {Card, Button} from 'react-bootstrap'
import './Card.css'

import lotr from './images/lord_of_the_rings.jpg'
import hobbit from './images/the_hobbit.jpg'
import grinch from './images/the_grinch.jpg'
import sing from './images/sing.jpg'
import insideOut from '../images/inside_out.jpg'


export default function SubCard(){
    const cardContent = [
        {image: lotr, name: "Netflix", location: "Fantasy/Adventure", price:"2001"}, 
        {image: hobbit, name: "Netflix", location: "Fantasy/Adventure", price:"2013"}, 
        {image: grinch, name: "Netflix", location: "Family/Comedy", price:"2000"}, 
        {image: sing, name: "Netflix", location: "Family/Musical", price:"2016"}
    ]; 

    const renderCard = (card, index) => {
        return (
            <Card style={{ width: '10rem'}} key={index} className="subCard">
                <Card.Body>
                    <Card.Title style={{height: '0rem'}} className="">{card.title}</Card.Title>
                    <Card.Text style={{height: '0rem'}} className="">{card.service}</Card.Text>
                    <Card.Link href="">Remove Service</Card.Link>
                    </Card.Body>
                </Card>
        ); 
    }; 
    return <div className="subGrid">{cardContent.map(renderCard)}</div>; 
};
